import React, { useState, useEffect } from "react";
import MeetingRoomItem from "./MeetingRoomItem";
import axios from "axios";

function MeetingRooms() {
  const [meetingRooms, setMeetingRooms] = useState([]);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    const fetchMeetingRooms = (async) => {
      setLoading(true);
      const res = axios.get("https://localhost:44388/api/MeetingRooms");
      setMeetingRooms(res.data);
      setLoading(false);
    };

    fetchMeetingRooms();
  }, []);

  return meetingRooms.map((meetingroom) => (
    <MeetingRoomItem
      key={meetingroom.id}
      meetingroom={meetingroom}
      addMeeting={this.props.addMeeting}
    />
  ));
}

export default MeetingRooms;
